import React from 'react';
import "./admin.css";
import Body from '../../components/Admin/Body/Body';
import NavBar from '../../components/Admin/Navigation/NavBar';
import CreatePopup from '../../components/Popups/CreatePopup/CreatePopup';

export default function Admin() {
  return (
    <div>
        <NavBar/>
        <CreatePopup trigger = {true}>
          <h1>hi</h1>
        </CreatePopup>
        <Body/>
    </div>
  )
}
